import React from 'react';
import { Box, Typography, Link, Grid, Divider, TextField, Button } from '@mui/material';
import { styled } from '@mui/system';
import baaMbooLogo from '../assets/mainlogo1.png';

const PageContainer = styled(Box)({
  maxWidth: '1440px',
  width: '100%',
  margin: '0 auto',
  padding: { xs: '0 15px', sm: '0 20px' },
});

const StyledFooter = styled(Box)({
  backgroundColor: '#000000',
  color: '#ffffff',
  padding: '40px 0', // Reduced padding for a more compact look
  bottom: 0,
  position: 'relative',
});

const FooterLink = styled(Link)({
  color: '#d3d3d3',
  textDecoration: 'none',
  fontSize: '0.85rem', // Reduced font size for links
  transition: 'color 0.3s ease',
  '&:hover': {
    color: '#28b463',
  },
});

const FooterSectionTitle = styled(Typography)({
  color: '#ffffff',
  fontWeight: 'bold',
  marginBottom: '15px',
  fontSize: '1rem', // Reduced font size for section titles
});

const SocialIcon = styled(Link)({
  color: '#ffffff',
  margin: '0 10px',
  fontSize: '1.5rem', // Slightly smaller icons
  transition: 'color 0.3s ease',
  '&:hover': {
    color: '#28b463',
  },
});

const LogoImage = styled('img')({
  height: '40px', // Adjusted logo size
  width: '180px',
  marginBottom: '20px',
});

const NewsletterInput = styled(TextField)({
  '& .MuiInputBase-root': {
    backgroundColor: '#ffffff',
    borderRadius: '4px',
    padding: '5px',
  },
  '& .MuiInputBase-input': {
    color: '#000000',
    fontSize: '0.85rem', // Reduced font size for input
  },
});

const SubscribeButton = styled(Button)({
  backgroundColor: '#28b463',
  color: '#ffffff',
  padding: '8px 20px', // Slightly smaller button
  borderRadius: '4px',
  fontSize: '0.85rem', // Reduced font size for button
  transition: 'backgroundColor 0.3s ease',
  '&:hover': {
    backgroundColor: '#229954',
  },
});

const Footer = () => {
  return (
    <StyledFooter component="footer">
      <PageContainer>
        <Grid container spacing={3} justifyContent="space-between">
          {/* Logo in the top-left corner */}
          <Grid item xs={12}>
            <LogoImage src={baaMbooLogo} alt="Baa M Boo Logo" />
          </Grid>

          {/* Customer Service Section */}
          <Grid item xs={12} sm={6} md={3}>
            <FooterSectionTitle variant="h6">Customer Service</FooterSectionTitle>
            <Box sx={{ display: 'flex', flexDirection: 'column', gap: 1 }}>
              <FooterLink href="#account">My Account</FooterLink>
              <FooterLink href="#chat">Live Chat</FooterLink>
              <FooterLink href="#support">Customer Support</FooterLink>
              <FooterLink href="#shipping">Shipping & Delivery</FooterLink>
              <FooterLink href="#returns">Returns & Exchanges Policy</FooterLink>
              <FooterLink href="#start-return">Start a Free Return or Exchange</FooterLink>
              <FooterLink href="#order-status">Check Order Status</FooterLink>
              <FooterLink href="#gift-cards">Gift Cards</FooterLink>
            </Box>
          </Grid>

          {/* Company Section */}
          <Grid item xs={12} sm={6} md={3}>
            <FooterSectionTitle variant="h6">Company</FooterSectionTitle>
